import React from 'react';
import Styled from 'styled-components';

// import components
import HeaderMain from "../Headers/HeaderMain";

import cloud from '../Images/teaching.jpg';

export default function Volunteer(props){
return(
    <HeaderMain
    headerHeight="80px"
    bgColor="red"
    links={["Resources","Support","Profile"]}
    urlLogo = {cloud}
    />
)
}
